import React from "react";
//소개글 / 학력 / 경력 / 포트폴리오
const nav = () => {
  return (
    <div className="container">
      <div>소개</div>
      <div>학력</div>
      <div>경력</div>
      <div>포트폴리오</div>
    </div>
  );
};

export default nav;
